class _CountAction(Action):
    
    def __init__(self = None, option_strings = None, dest = None, default = None, required = None, help = None):
        super(_CountAction, self).__init__(option_strings, dest, 0, default, required, help, **('option_strings', 'dest', 'nargs', 'default', 'required', 'help'))

    
    def __call__(self, parser, namespace, values, option_string = (None,)):
        count = getattr(namespace, self.dest, None)
        if count is None:
            count = 0
            setattr(namespace, self.dest, count + 1)
            return None

    __classcell__ = None


